import Receiver from './Receiver'
import Caller from './caller'
import './App.css'



let name= "Tamer",
  Adress= "Madinaty",
  time = new Date().toLocaleString()


export default class App extends Component{
  render(){
    return(
      <div>
          <ol>
             <li> <Receiver
              name={name}
              Adress={Adress}
              hello = {this.props.sayHello}
              /></li>
              <br></br>
              <li> < Caller
                name={name}
                Adress={Adress}
              /></li >
          </ol>
        <div className ="div-child"> this the time now {time} </div>

      </div>
    )
  }


} 






